    FormGroup,
    Label,
    Input,
    Col,
    Row
} from 'reactstrap';

//회원 가입
const SignIn = (props) => {
    const [rSelected, setRSelected] = useState(null);
    return (
        <div className = 'signIn_container'>
            <ButtonGroup className = "w-100" style = {{marginBottom : '5px'}}>
                <Button className = "w-25" color = 'primary' onClick={()=> setRSelected("mentor")}>멘토</Button>
                <Button className = "w-25" color = 'primary' onClick={()=> setRSelected("regionManager")}>연계기관 담당자</Button>
            </ButtonGroup>
            <Form>

            </Form>
        </div>
    )
}
export default SignIn;
